package com.example.demo.models;import lombok.*;import org.springframework.data.annotation.CreatedDate;import org.springframework.data.annotation.Id;import org.springframework.data.annotation.LastModifiedDate;import org.springframework.data.annotation.ReadOnlyProperty;import org.springframework.data.relational.core.mapping.Column;import org.springframework.data.relational.core.mapping.Table;import java.time.LocalDateTime;@Getter@Setter@NoArgsConstructor@AllArgsConstructor@Table(name = "CONTACT", schema = "BACKEND")@ToStringpublic class Contact {    @Id    @Column("ID")    int id;    @Column("PHONE_NUMBER")    String phoneNumber;    @Column("EMAIL")    String email;    @Column("LINKED_ID")    Integer linkedId;    @Column("LINK_PRECEDENCE")    LinkPrecedence linkPrecedence;    @Column("CREATED_AT")    @CreatedDate    @ReadOnlyProperty    LocalDateTime createdAt;    @Column("UPDATED_AT")    @LastModifiedDate    @ReadOnlyProperty    LocalDateTime updatedAt;    @Column("DELETED_AT")    LocalDateTime deletedAt;    @Getter    @AllArgsConstructor    public enum LinkPrecedence {        PRIMARY("primary"), SECONDARY("secondary");        private final String value;    }}